import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';

const dataColors = [
  {
    number: 1,
    color: '#2c88d9'
  },
  {
    number: 2,
    color: '#d3455b'
  },
  {
    number: 3,
    color: '#897a5f'
  },
  {
    number: 4,
    color: '#ac6363'
  },

  {
    number: 5,
    color: '#763ec3'
  },
  {
    number: 7,
    color: '#387968'
  },
  {
    number: 8,
    color: '#6558f5'
  },
  {
    number: 6,
    color: '#53af9f'
  },
  {
    number: 9,
    color: '#4b5c6b'
  }
]

const randNumbers = () => {
  alert('RANDOM COLOR');
  new_random = colors.ssort( () => .5 - Math.random() );
  setColors()
}

function App() {
  const [colors, setColors] = useState(dataColors);

  return (
    <div className="App">
      <div className="container">
        <div className="masonry-columns">
          { colors.map((b) => {
            return (
              <div className= 'box' style={{background: b.color}} onClick={(e) => randNumbers()}>
                {b.number}
              </div>
            )
          })}
        </div>
      </div>
    </div>
  );
}

export default App;
